import React from "react";
import Square from "./Square.js";
import { useState } from "react";

const Grid = ({ board }) => {
  const [value, setValue] = useState(3);
  const handleSubmit = (e) => {
    if (e.target.value === 2) {
      setValue(e.target.value);
      console.log(value);
    }
  };

  const grid = [];
  for (let row = 0; row < 9; row++) {
    grid.push([]);
    for (let col = 0; col < 9; col++) {
      if ((row + 1) % 3 === 0) {
        if ((col + 1) % 3 === 0) {
          grid[row].push(
            <div className="gridlines-bottom gridlines-right center">
              <Square value={value} handleSubmit={handleSubmit} />
              {/* {board[row][col]} */}
            </div>
          );
        } else {
          grid[row].push(
            <div className="gridlines-bottom center">
              <Square value={value} handleSubmit={handleSubmit} />
              {/* {board[row][col]} */}
            </div>
          );
        }
      } else if ((col + 1) % 3 === 0) {
        grid[row].push(
          <div className="gridlines-right center">
            <Square value={value} handleSubmit={handleSubmit} />
            {/* {board[row][col]} */}
          </div>
        );
      } else {
        grid[row].push(
          <div className="center">
            <Square value={value} handleSubmit={handleSubmit} />
            {/* {board[row][col]} */}
          </div>
        );
      }
    }
  }
  return <div className="grid-board">{grid}</div>;
};

export default Grid;
